import styled from "styled-components";

export const Input = styled.input`
  background: white;
  border: none;
  padding: 8px 4px;
  max-width: 400px;
  text-align: left;
  line-height: 24px;
  font-size: 13px;
  transition: all 0.2s ease;
  outline: none;
`
